import React from "react";
import "./FacPage.css"

class FacPage extends React.Component {
    constructor (props) {
        super(props);
        this.state = {
            members: ["1", "2", "3"].map((members) => 
                <div className="member" id={`member${members}`}></div>
            ),
        }
    }

    render() {
        return (
            <div id="members">
                {this.state.members}
                {console.log(document.getElementById("member1"))}
            </div>
        )
    }
}

export default FacPage;
